import React from 'react';

import Main from '../layout/main/Main';

import styling from './AboutMe.module.scss';


const AboutMeComponent = ({ AboutMeData }) => {
    console.log(AboutMeData, '###')
    return (
        <Main title="about-me">
            <div className={styling.header}>
                <img
                    src="https://unlix.ru/wp-content/uploads/2019/04/Python-940x940.png"
                    className={styling.previewImageBackground}
                    alt='preview image background'
                />
            </div>
            <article className={styling.elements}>
                <img
                    src="https://cdn.onlinewebfonts.com/svg/img_573758.png"
                    className={styling.previewImage}
                    alt='preview image'
                />
                <h1 align='center'>{AboutMeData.title}</h1>
                <div className={styling.wrapper}>
                    {AboutMeData.text}
                </div>
            </article>
        </Main>
    );
};

export async function getStaticProps(context) {
    const res = await fetch(API_URL + 'about-me')
    const data = await res.json()
    if (!data) {
        return {
          notFound: true,
        }
    }

    return {
        props: {}, // will be passed to the page component as props
    }
}


export default AboutMeComponent;
